import React from 'react';
import styled,{css} from 'styled-components/macro';
import {Link} from 'react-router-dom';
import {menueData} from '../Data/MenueData';
const Nav=styled.nav`
height:60px;
background: #000;
display:flex;
justify-content:space-between;
padding:1rem 2rem;
z-index: 100;
position:fixed;
width:100%;
`;

const NavLink=css`
color:#fff;
dicplay:flex;
align-items:center;
padding : 0 1rem;
height:100%;
cursor:pointer;

`;
const Logo=styled(Link)`
${NavLink}
font-style:italic;
`;

const MenuBars=styled.i``;
const NavMenu=styled.div``;

const NavMenueLinks=styled(Link)``;

const Navbar = () => {
    return (
        <Nav>
            <Logo to="/">Spinzer</Logo>
            <MenuBars/>
            <NavMenu>
                {menueData.map(( items,index) => (
                    <NavMenueLinks to={items.Link} key={index}>
                        {items.title}
                    </NavMenueLinks>
                ))}
            </NavMenu>
        </Nav>
    )
}

export default Navbar
